INSERT INTO series (id, description, is_series, language, name, picture, rating, watched) VALUES ('SH031459900000','Comedy game show hosted by Josh Widdicombe and James Acaster, in which leading comedians are posed increasingly absurd hypothetical situations.',NULL,'GBR','Hypothetical','https://s3.amazonaws.com/schedulesdirect/assets/p16485312_b_h13_aa.jpg',4,NULL),('SH019673190000','Polen ist das unbekannte Land im Herzen Europas. Im Spannungsfeld zwischen Tradition und Moderne, lÃ¤ndlicher Idylle und Aufbruchswillen prÃ¤sentiert sich das heutige Polen in der dreiteiligen Dokureihe. Die erste Folge beginnt ganz oben: Die rund 1.600 Meter hohe Schneekoppe im Riesengebirge ist einer der windigsten Orte Europas. Wie ein Raumschiff sieht die Wetterstation aus, in der Piotr Kraczkowski als Meteorologe arbeitet.',NULL,'DEU','Polen entdecken!','https://s3.amazonaws.com/schedulesdirect/assets/p10950949_b_v6_aa.jpg',4,NULL),('SH028367140000','Die Sendung wirft einen Blick zurÃ¼ck auf die Probleme und Ãngste der 1980er Jahre. Das WettrÃ¼sten im Kalten Krieg und Zukunfsvisionen Ã  la George Orwell werden unter anderem ins Visier gefasst.',NULL,'DEU','Die 80er - Das explosive Jahrzehnt','https://s3.amazonaws.com/schedulesdirect/assets/p14898905_st_h13_aa.jpg',4,NULL),('SH012943500000','\"Nazi Hunters\" tells of how an unrelenting band of secret agents and avengers hunted down some of the most evil men in history and finally brought them to justice. Included are tales of the pursuit of Adolf Eichmann, Erich Priebke, \"Butcher of Lyon\" Klaus Barbie, and \"Angel of Death\" Josef Mengele.',NULL,'GBR','Nazi Hunters','https://json.schedulesdirect.org/20141201/image/assets/p8173535_i_v2_aa.jpg',4,NULL),('SH018815340000','Documentary series featuring the families and individuals involved in the world of Irish dancing.',NULL,'GBR','Jigs and Wigs: The Extreme World of Irish Dancing','https://s3.amazonaws.com/schedulesdirect/assets/p10572491_b_h5_aa.jpg',4,NULL),('SH013634930000','The life of the officers and men of the King\'s Fusiliers infantry regiment, at home and at battle.',NULL,'GBR','Soldier, Soldier','https://s3.amazonaws.com/schedulesdirect/assets/p490454_b_h13_aa.jpg',4,NULL),('SH018788800000','Hier erlÃ¤utert die Fitness-Expertin Barbara Klein detailliert die positiven Auswirkungen der von ihr mitentwickelten NutraLinea-NahrungsergÃ¤nzung rund um Gewicht und Fitness.',NULL,'DEU','NutraLinea by Barbara Klein','https://s3.amazonaws.com/schedulesdirect/assets/p10562120_st_h13_aa.jpg',4,NULL),('SH019656370000','Die Dokumentationsreihe berichtet Ã¼ber Geschichten von exotischen SchauplÃ¤tzen, auÃergewÃ¶hnlichen Menschen, wenig erforschten Tierarten sowie erstaunlichen NaturphÃ¤nomenen, und zeigt interessante Forschungsberichte Ã¼ber die Tiefsee.',NULL,'DEU','mare TV kompakt','https://json.schedulesdirect.org/20141201/image/assets/p10944077_b_h13_aa.jpg',4,NULL),('SH019560060000','Die Sendung berichtet Ã¼ber Themen aus den Bereichen Wissenschaft, Technik und Mensch. Auf unterschiedliche Fragen wird versucht, Antworten zu finden und diese auf unkomplizierte und leicht verstÃ¤ndliche Weise zu vermitteln.',NULL,'DEU','Abenteuer Leben tÃ¤glich','https://s3.amazonaws.com/schedulesdirect/assets/p10903651_st_h13_ab.jpg',4,NULL),('SH013022490000','Chef Gordon Ramsay hits the road in search of restaurants in crisis, where he steps in and addresses some of the most stressful aspects of running a successful food business. Ramsay and his team redecorate each eatery to give it a fresh look in the hope of attracting a larger crowd. Ramsay\'s ultimate goal is to make the restaurants he visits profitable for their struggling owners.',NULL,'GBR','Ramsay\'s Kitchen Nightmares USA','https://s3.amazonaws.com/schedulesdirect/assets/p185566_i_h13_ab.jpg',4,NULL),('SH012595550000','Sick, twisted and politically incorrect, the animated series features the adventures of the Griffin family. Endearingly ignorant Peter and stay-at-home wife Lois reside in Quahog, R.I., and have three kids. Meg, the eldest child, is a social outcast, and teenage Chris is awkward and clueless when it comes to the opposite sex. The youngest, Stewie, is a genius baby bent on killing his mother and destroying the world. The talking dog, Brian, keeps Stewie in check while sipping martinis and sorting through his own life issues.',NULL,'GBR','Family Guy','https://s3.amazonaws.com/schedulesdirect/assets/p184483_i_v6_ab.jpg',4,NULL),('SH032583120000','Der Zweite Weltkrieg ist kaum beendet, da beginnt der Wettstreit der Systeme. Die Dokumentation widmet sich der Entstehung und Entwicklung des Kalten Kriegs in Deutschland unter dem Druck der beiden fÃ¼hrenden WeltmÃ¤chte USA und Sowjetunion.',NULL,'DEU','Deutschland im Kalten Krieg','https://s3.amazonaws.com/schedulesdirect/assets/p17080502_b_v2_aa.jpg',4,NULL),('SH029945820000','Romesh Ranganathan is a comedian and TV presenter whose idea of a nice trip away is two weeks in the Algarve. In this series he\'s travelling way beyond his comfort zone to some of the most beautiful, but dangerous places on earth.',NULL,'GBR','The Misadventures of Romesh Ranganathan','https://s3.amazonaws.com/schedulesdirect/assets/p15654045_b_h13_aa.jpg',4,NULL),('SH019655640000','Kochsendung im hr-fernsehen.',NULL,'DEU','Hessen Ã  la carte','https://s3.amazonaws.com/schedulesdirect/assets/p10943917_b_h13_aa.jpg',4,NULL),('SH023535090000','Swords may not be the weapon of choice for many people nowadays, but that doesn\'t stop some from continuing to work as bladesmiths. \"Forged in Fire\' tests some of the best in the field as they attempt to re-create some of history\'s most iconic edged weapons. Former Army Ranger Wil Willis hosts the competition series that sees four master bladesmiths challenged in each episode to forge the swords, which are then tested by a panel of judges consisting of J. Neilson, who has been making knives for more than 20 years, hand-to-hand combat specialist Doug Marcaida, and David Baker, an authority on replicating period-accurate weaponry. The contestant who survives the elimination rounds and wins the episode\"s contest earns $10,000 and the title of Forged in Fire champion.',NULL,'GBR','Forged in Fire','https://json.schedulesdirect.org/20141201/image/assets/p11771815_i_h5_ab.jpg',4,NULL),('SH031707160000','Following 16 promising professional boxers who have come to Los Angeles to compete in a tournament, with the final in Las Vegas. These men will live together, train together and eventually fight each other for the chance to change their lives.',NULL,'GBR','The Contender','https://json.schedulesdirect.org/20141201/image/assets/p187583_i_h5_aa.jpg',4,NULL),('SH013005830000','Waverly council lifeguards patrol the shores of Australia\'s famous Bondi Beach, where they face a multitude of challenges, and participate in daring rescues to ensure that the guests experience a safe environment at the beach.',NULL,'GBR','Bondi Rescue','https://s3.amazonaws.com/schedulesdirect/assets/p343242_b_h5_ac.jpg',4,NULL),('SH015402070000','Ratgebermagazin rund um die Gesundheit.',NULL,'DEU','Hauptsache gesund','https://json.schedulesdirect.org/20141201/image/assets/p9125757_b_h13_aa.jpg',4,NULL),('SH024188130000','\"New Zealand: Earth\'s Mythical Islands\" is a documentary narrated by actor Sam Neill. The miniseries captures the wildlife of New Zealand\'s remote island chain where nature has been left undisturbed since the age of the dinosaurs. Episodes reveal the exotic and ancient creatures that inhabit the mysterious islands as well as exploring the geological activities that have shaped the land. Amongst the giant insects, dinosaur-like reptiles and flightless birds there are also small communities of people who have settled in unexpected and danger-filled environments.',NULL,'GBR','New Zealand: Earth\'s Mythical Islands','https://json.schedulesdirect.org/20141201/image/assets/p12837422_i_h13_aa.jpg',4,NULL),('SH032268380000','Die StrohhÃ¼te landen auf der Insel Dressrosa. Nachdem sie von Doflamingos Eroberung des KÃ¶nigreichs erfahren haben, schlieÃen sich die StrohhÃ¼te mit den RevolutionÃ¤ren und Prinzessin Viola zusammen, um Doflamingo zu stÃ¼rzen und die Insel zu retten.',NULL,'DEU','One Piece','https://s3.amazonaws.com/schedulesdirect/assets/p12201877_st_h13_aa.jpg',4,NULL),('SH025069650000','Canadian-born Dave and Kortney Wilson met in Nashville, Tennessee, and a few years later they were making a family and music together, dropping their solo careers to perform as the Wilsons. Ever creative, Dave and Kortney have since packed the microphones and left the studio to take advantage of the Music City\'s burgeoning housing market. \"Masters of Flip\' tells of the couple\"s adventures through the messes and stresses of renovations and the anticipation of enormous profits. Tireless contractor Dave and award-winning realtor Kortney have built their real estate business through flips, buy and hold properties, and vacation rentals.',NULL,'GBR','Masters of Flip','https://s3.amazonaws.com/schedulesdirect/assets/p11680488_b_h5_ad.jpg',4,NULL),('SH022488570000','A comprehensive round-up of all the weekend\'s action in Spain\'s LaLiga.',NULL,'GBR','LaLiga World','https://s3.amazonaws.com/schedulesdirect/assets/p12043305_b_h13_aa.jpg',4,NULL),('SH014069440000','Coverage of a fixture from the top division of the Spanish football league system.',NULL,'GBR','LaLiga Football','https://s3.amazonaws.com/schedulesdirect/assets/p8626808_b_h13_ab.jpg',4,NULL),('SH016571710000','An insight into this rarely seen world of high stakes, colourful characters and extreme conditions.',NULL,'GBR','Outback Truckers','https://json.schedulesdirect.org/20141201/image/assets/p9629919_i_h13_ab.jpg',4,NULL),('SH029251830000','Es werden unter anderem Ã¼ber Fakten und Fragen zu unterschiedlichen Themen diskutiert.',NULL,'DEU','alpha-Thema GesprÃ¤ch','https://s3.amazonaws.com/schedulesdirect/assets/p15293238_st_h13_aa.jpg',4,NULL),('SH019672380000','Geschichten aus Gesellschaft, Wissenschaft und Kultur: Ereignisse, die bewegten und bewegen.',NULL,'DEU','Der Osten: Entdecke wo du lebst','https://s3.amazonaws.com/schedulesdirect/assets/p10950638_b_h13_aa.jpg',4,NULL),('SH021307930000','39 Menschen haben sich bereit erklÃ¤rt, an einem Selbstversuch teilzunehmen, ohne genau zu wissen, was auf sie zukommt. In dem Antirassismus-Training, das die Teilnehmer erwartet, werden sie anhand ihrer Augenfarbe in zwei Gruppen eingeteilt. Die BlauÃ¤ugigen werden von Beginn an gedemÃ¼tigt, wÃ¤hrend die BraunÃ¤ugigen erfahren, wie stark das GefÃ¼hl der Macht sein kann und wie sehr es verunsichert.',NULL,'DEU','Der Rassist in uns','https://s3.amazonaws.com/schedulesdirect/assets/p11526662_b_h13_aa.jpg',4,NULL),('SH024709820000','Anna Richardson presents \"Naked Attraction\", a dating show that begins where some dates may end: naked. Singletons get up close and personal as they meet for the first time in their birthday suits, stripped of all clothes, make-up and status symbols. This social experiment is inspired by evolutionary science, where it is believed that in the past people selected mates based on physical appearance. Contestants get in touch with their primal instincts as they narrow down their potential match from a group of six nude hopefuls.',NULL,'GBR','Naked Attraction','https://s3.amazonaws.com/schedulesdirect/assets/p13079827_i_h13_aa.jpg',4,NULL),('SH013286270000','A short broadcast made by a political party.',NULL,'GBR','Party Political Broadcast','https://s3.amazonaws.com/schedulesdirect/assets/p849531_b_h13_aa.jpg',4,NULL),('SH034253870000','In der Rateshow mÃ¼ssen Kandidatenpaar den Wert verschiedener GegenstÃ¤nde richtig schÃ¤tzen. Es geht ganz schÃ¶n zur Sache, und wem es gelingt, am Ende den wertvollsten Gegenstand ausgewÃ¤hlt zu haben, rÃ¤umt den Gegenwert in Cash ab.',NULL,'DEU','Kitsch oder Kasse','https://s3.amazonaws.com/schedulesdirect/assets/p17860386_st_h13_aa.jpg',4,NULL),('SH034314030000','Deutschlands bekanntester Make-up-KÃ¼nstler Boris Entrup hat bereits BerÃ¼hmtheiten wie Topmodel Naomi Campbell und Angelina Jolie fÃ¼r Auftritte geschminkt. In dieser Sendung sucht er frische Talente, die unterschiedliche Looks kreieren kÃ¶nnen.',NULL,'DEU','Let\'s Glow - Die Make-Up-Challenge','https://s3.amazonaws.com/schedulesdirect/assets/p17898512_st_h13_aa.jpg',4,NULL),('SH020143070000','ZIB 2 - das ist das tÃ¤gliche Nachrichten-Magazin des ORF-Fernsehens. Die Sendung setzt Schwerpunkte und liefert HintergrÃ¼nde.',NULL,'DEU','ZIB 2','https://s3.amazonaws.com/schedulesdirect/assets/p11119175_i_h13_aa.jpg',4,NULL),('SH015829260000','The daytime game show, presented by Ben Shephard, features contestants getting a chance to play a large coin-drop machine, provided they answer questions correctly. Wrong answers and the players could be eliminated. The last contestant standing has an opportunity to win the machine\'s Â£10,000 jackpot.',NULL,'GBR','Tipping Point','https://json.schedulesdirect.org/20141201/image/assets/p9322562_i_h5_aa.jpg',4,NULL),('SH021649870000','In the 1980s, geeky 11-year-old Adam uses a video camera to document his family\'s crazy life. His mother, Beverly, is overprotective and lacks boundaries, while his dad has a hot temper and finds it difficult to parent without screaming. Rounding out the clan are Adam\'s terrifying sister, Erica, 17; his older brother, Barry, who has middle-child syndrome; and the family\'s beloved grandfather, Al \"Pops\" Solomon. Pops is responsible for wild antics, including offering drinks to Barry and teaching Adam about the ways of love - which create more chaos in an already high-strung family.',NULL,'GBR','The Goldbergs','https://s3.amazonaws.com/schedulesdirect/assets/p9977319_l_h5_ab.jpg',4,NULL),('SH017028920000','Eine Geburt ist ein Wunder - fÃ¼r die Eltern jedoch meist auch eine emotionale Achterbahnfahrt. Die Doku-Serie gibt einen Einblick in den Alltag im Klinikum SÃ¼dstadt Rostock, in dem jedes Jahr ca. 3000 Entbindungen stattfinden.',NULL,'DEU','Babys! Kleines Wunder - groÃes GlÃ¼ck','https://json.schedulesdirect.org/20141201/image/assets/p9804879_st_h13_aa.jpg',4,NULL),('SH022375990000','Dan Snow, Anita Rani, Robert Llewellyn and John Sergeant travel to India to explore the science behind the systems running the world\'s busiest railway from the Chhatrapati Shivaji Terminus in Mumbai. The team meets the people who keep the large transport structure organised and on time. However, even on a good day, the commuter trains have up to 14 people crushed into a square metre; Snow, Rani and Llewellyn experience this first hand as they travel in carriages twice as packed as most busy UK trains. Elsewhere, Sergeant discovers more about India\'s historical connection with teas and trains at Darjeeling\'s steam-powered hill railway.',NULL,'GBR','World\'s Busiest Railways','https://s3.amazonaws.com/schedulesdirect/assets/p11991693_b_h13_ad.jpg',4,NULL),('SH013025950000','The very best Super League action with game analysis and special features.',NULL,'GBR','The Super League Show','https://s3.amazonaws.com/schedulesdirect/assets/p511443_b_v6_ac.jpg',4,NULL),('SH018446000000','Lisa Vanderpump first gained fame as a cast member on \"The Real Housewives of Beverly Hills\', but her full-time job is as co-owner and boss at West Hollywood, California, restaurant SUR, which stands for Sexy Unique Restaurant. Vanderpump balances her motherly instinct with her shrewd business sense to maintain control over the restaurant\'s wild group of employees who are working at the eatery while pursuing their dreams. SUR\"s employees include server Stassi, who wants to be the next big thing in fashion, and her sometimes boyfriend, bartender Jax, who is a model.',NULL,'GBR','Vanderpump Rules','https://s3.amazonaws.com/schedulesdirect/assets/p9656862_l_h5_aa.jpg',4,NULL),('SH012846970000','Chiropractor and single father Alan Harper lives in a beachfront house with his underachieving son, Jake, and divorced Internet billionaire Walden Schmidt. Schmidt moves in with the Harpers and offers to buy the house following the untimely death of Alan\'s brother, Charlie, who owned the house and had lived there with Alan and Jake when the father and son moved in following Alan\'s divorce. Alan\'s ex-wife and Jake\'s mother, Judith, remains a part of their lives. Also featured in the series are Alan\'s mother, Evelyn, and sharp-tongued housekeeper Berta.',NULL,'GBR','Two and a Half Men','https://s3.amazonaws.com/schedulesdirect/assets/p8218909_b_v2_aa.jpg',4,NULL),('SH033118560000','Following the lives of a small community of garden dwellers, who try to solve the problems of everyday life with a positive attitude.',NULL,'GBR','Tall Tales','https://json.schedulesdirect.org/20141201/image/assets/p17364893_b_v2_aa.jpg',4,NULL),('SH022240170000','Jamaican producer Lee \"Scratch\" Perry looks back on his life and work and the music that influenced him.',NULL,'GBR','The Upsetter: Lee `Scratch\' Perry in His Own Words','https://json.schedulesdirect.org/20141201/image/assets/p11929775_st_h13_aa.jpg',4,NULL),('SH018042140000','With more than one million reports of animal cruelty and mistreatment every year, the RSPCA is under increased pressure to keep Britain\'s pets safe from abusive owners and unscrupulous breeders. \"The Dog Rescuers\' follows the organisation\'s inspectors as they track down some of the UK\"s abused and mistreated animals in an attempt to rescue them. Among the crimes against dogs that they investigate are poor living conditions, illegal mass breeding, malnutrition and organised fights. When successful in rescuing the dogs, the animals are rehabilitated and eventually given new homes.',NULL,'GBR','The Dog Rescuers','https://json.schedulesdirect.org/20141201/image/assets/p10243572_i_v6_aa.jpg',4,NULL),('SH028880440000','Talented young cooks take over the kitchen and celebrate their heritage by cooking some very special recipes. They discover where these dishes and ingredients come from a