y series shows how Short and his team meticulously refurbish some of America\'s favourite rides. Drama ensues in the form of personality clashes, cost overruns, irate customers and other issues, which are compounded by Short\'s reputation as a straight shooter who won\'t accept substandard results.',NULL,'GBR','FantomWorks','https://s3.amazonaws.com/schedulesdirect/assets/p9944361_l_h5_aa.jpg',4,NULL),('SH032348020000','Some of the original \"Total Drama\" characters enter into an alternate universe where they are aged down from teenagers to toddlers.',NULL,'GBR','Total DramaRama','https://s3.amazonaws.com/schedulesdirect/assets/p15787042_b_h13_aa.jpg',4,NULL),('SH019345410000','More Britons are living off of benefits now that at any time since the welfare system was first established, with many of the claimants spending more time on benefits than they have spent working. With the benefits system undergoing a major overhaul and new rules in place, life is getting tougher for many people on the benefits system. This programme profiles people on benefits, some of whom have never held a job and others who feel that work just does not pay. It takes a look at people fighting for jobs, those trying to live on less than Â£5 a day and those who are adept at beating the system.',NULL,'GBR','Benefits Britain: Life on the Dole','https://s3.amazonaws.com/schedulesdirect/assets/p10826254_b_h13_aa.jpg',4,NULL),('SH021336340000','Action from the Swedish Hockey League, the highest division in the Swedish ice hockey system.',NULL,'GBR','Swedish Hockey League','https://s3.amazonaws.com/schedulesdirect/assets/p11538792_b_h13_aa.jpg',4,NULL),('SH014190010000','\"The working man\'s bank\' is always willing to make a deal. That\'s why for the people of Detroit, the go-to pawn shop for more than four decades has been American Jewelry and Loan. This series follows its day-to-day operations, focusing on third-generation pawnbroker and company patriarch Les Gold, a street-smart old-schooler 