onstructs some of the most interesting and startling criminal cases from the UK, Ireland, the United States and Canada of the past twenty years. Detectives and law enforcers used to rely on a tool-kit consisting of a magnifying glass, a fingerprint dusting kit, and instinct developed from years of experience, in order to crack a case. In contemporary times, the twenty-first century investigator has an arsenal of modern techniques at their disposal. When crime happens, it always leaves a trace, and `Trace of Evil\" takes a closer look without having to resort to the use of a magnifying glass.',NULL,'GBR','Evidence of Evil','https://json.schedulesdirect.org/20141201/image/assets/p15401610_i_h13_aa.jpg',4,NULL),('SH013133670000','Music and celebrity chat with special guests, music and a host of other features.',NULL,'GBR','Steve Wright in the Afternoon','https://json.schedulesdirect.org/20141201/image/assets/p8238492_b_h5_aa.jpg',4,NULL),('SH012885830000','Investigate the real crimes that go on behind the pristine picket-fences of the UK\'s suburbanites.',NULL,'GBR','Nightmare in Suburbia','https://s3.amazonaws.com/schedulesdirect/assets/p8155521_b_v6_aa.jpg',4,NULL),('SH028984620000','Dr Dylan Reinhart is a former CIA operative who\'s created a quieter life for himself as a professor and author of a best-selling book on abnormal behaviour. When tenacious and resourceful NYPD detective Lizzie Needham approaches him to help her solve a serial killer case, he taps into his old skill set and reaches out to a CIA friend who has access to invaluable top-secret intelligence. As Dylan gets lured back into the adrenaline-filled world of law enforcement, he and Lizzie realize that, together, they make the perfect team.',NULL,'GBR','Instinct','https://s3.amazonaws.com/schedulesdirect/assets/p14159105_b_h5_aa.jpg',4,NULL),('SH012608630000','\"New Tricks\" dramatises the work of the Unsolved Crime and Open Case Squad, led by Detective Superintendent Sandra Pullman and three previo