orage Wars','https://s3.amazonaws.com/schedulesdirect/assets/p8354064_i_v6_ab.jpg',4,NULL),('SH019668380000','Eine Reise durch die Zeit zu Ereignissen, die den Norden bewegten.',NULL,'DEU','Unsere Geschichte','https://s3.amazonaws.com/schedulesdirect/assets/p10949116_b_h13_aa.jpg',4,NULL),('SH014326800000','Lindsey Davis\'s adventures of a Roman detective, dramatised by Mary Cutler.',NULL,'GBR','Falco','https://json.schedulesdirect.org/20141201/image/assets/p8732663_b_h5_aa.jpg',4,NULL),('SH030672130000','Die achtjÃ¤hrigen Freunde Mats und Malika kommen jeden Tag zu spÃ¤t zur Schule. DafÃ¼r erleben sie auf ihrem Schulweg witzige Abenteuer. Fraglich ist, ob ihre Lehrer ihnen die Begegnungen mit Monstern, Geheimagenten und wilden Tieren abnehmen?',NULL,'DEU','Voll zu spÃ¤t!','https://s3.amazonaws.com/schedulesdirect/assets/p15427924_i_h13_aa.jpg',4,NULL),('SH031923850000','Documentary series that in each episode focuses on one individual with experience of an issue in the news.',NULL,'GBR','My Name Is..','https://json.schedulesdirect.org/20141201/image/assets/p16740218_st_h13_aa.jpg',4,NULL),('SH019001930000','Zusammen mit Woozle, einem zotteligen Beuteltier, geht Benedikt Weber sÃ¤mtlichen Alltagsfragen auf den Grund. WÃ¤hrend er versucht, seine Antworten wissenschaftlich zu begrÃ¼nden, bevorzugt Woozle kreativere LÃ¶sungsansÃ¤tze.',NULL,'DEU','Woozle Goozle','https://s3.amazonaws.com/schedulesdirect/assets/p10672039_st_h13_aa.jpg',4,NULL),('SH023316320000','Once again presenter Jimmy Carr oversees a panel of top-name celebrities in \"Big Fat Quiz of Everything\', a quiz show where they compete to see who can answer the most questions correctly. The rounds are primarily based on past, and recent, popular culture, news and events. Three teams composed of two celebrities each earn points for correct answers, and the team with the most points at game\"s end wins the Big Fat Quiz crown. Featuring is Mel Giedroyc, Claudia Winkleman, David Mitchell, Jonathan Ross, Bob Mort